
#include <iostream>
#include <string>

using namespace std;

string minWindow(string S, string T) {
	if (S.empty() || T.empty()) return "";
	int size = S.length(), count = T.length();
	int ht[256] = { 0 };
	bool ft[256] = { false };
	for (int t = 0; t < count; t++) {
		ht[T[t]]++; ft[T[t]] = true;
	}
	
	int start = 0, len = INT_MAX;
	int i = 0, j = -1;
	while (i < size && j < size) {
		if (count) {
			j++;
			ht[S[j]]--;
			if (ft[S[j]] && ht[S[j]] >= 0) count--;
		}
		else {
			if (j + 1 - i < len) {
				start = i; len = j + 1 - i;
			}
			ht[S[i]]++;
			if (ft[S[i]] && ht[S[i]] > 0) count++;
			i++;
		}
	}
	
	if (len == INT_MAX) return "";
	return S.substr(start, len);
}

string minWindow2(string S, string T) {
	if (S.empty() || T.empty())
	{
		return "";
	}
	int count = T.size();
	int require[128] = { 0 };
	bool chSet[128] = { false };
	for (int i = 0; i < count; ++i)
	{
		require[T[i]]++;
		chSet[T[i]] = true;
	}
	int i = -1;
	int j = 0;
	int minLen = INT_MAX;
	int minIdx = 0;
	while (i < (int)S.size() && j < (int)S.size())
	{
		if (count)
		{
			i++;
			require[S[i]]--;
			if (chSet[S[i]] && require[S[i]] >= 0)
			{
				count--;
			}
		}
		else
		{
			if (minLen > i - j + 1)
			{
				minLen = i - j + 1;
				minIdx = j;
			}
			require[S[j]]++;
			if (chSet[S[j]] && require[S[j]] > 0)
			{
				count++;
			}
			j++;
		}
	}
	if (minLen == INT_MAX)
	{
		return "";
	}
	return S.substr(minIdx, minLen);
}

string minWindow3(string S, string T) {
	if (S.size() == 0) return "";
	if (S.size() < T.size()) return "";
	int appearCount[256];
	int expectCount[256];
	memset(appearCount, 0, 256 * sizeof(appearCount[0]));
	memset(expectCount, 0, 256 * sizeof(appearCount[0]));
	for (int i = 0; i < T.size(); i++)
	{
		expectCount[T[i]]++;
	}
	int minV = INT_MAX, min_start = 0;
	int wid_start = 0;
	int appeared = 0;
	for (int wid_end = 0; wid_end< S.size(); wid_end++)
	{
		if (expectCount[S[wid_end]] > 0)// this char is a part of T  
		{
			appearCount[S[wid_end]]++;
			if (appearCount[S[wid_end]] <= expectCount[S[wid_end]])
				appeared++;
		}
		if (appeared == T.size())
		{
			while (appearCount[S[wid_start]] > expectCount[S[wid_start]]
				|| expectCount[S[wid_start]] == 0)
			{
				appearCount[S[wid_start]]--;
				wid_start++;
			}
			if (minV > (wid_end - wid_start + 1))
			{
				minV = wid_end - wid_start + 1;
				min_start = wid_start;
			}
		}
	}
	if (minV == INT_MAX) return "";
	return S.substr(min_start, minV);
}

